import React from 'react';
import {
    Box,
    Container
} from '@mui/material';
import { grey } from '@mui/material/colors';


const heroImagePath = './public/hero.jpg';
const heroStyle = {
    // backgroundImage: `url(${heroImagePath})`,
    background: grey[500]
}

const Hero = () => {
    return (
        <Container
            
        >
            <Box
                sx={heroStyle}
            >
            </Box>

        </Container>
    )
}

export default Hero;
